import React,{useState} from 'react';
import {View, Text,StyleSheet, TextInput,TouchableOpacity} from 'react-native';
import Title from './Title';
import { SelectList } from 'react-native-dropdown-select-list'


const SetQuiz = ({navigation}:{navigation:any}) =>{
    const[ques, setQues] = useState('');
    const[option1,setOption1] = useState('');
    const[option2,setOption2] = useState('');
    const[option3,setOption3] = useState('');
    const[option4,setOption4] = useState('');
    const[selectValue,setSelectValue] = useState(null);
    const selectedCourse = [
        {value:"MATH", label:"Math"},
        {value:"SCIENCE", label:"Science"},
        {value:"HISTORY", label:"History"},
        {value:"ENGLISH", label:"English"}
    ]
    const SaveQues = async ()=>{
        const quesInfo = {
            ques:ques,
            option1:option1,
            option2:option2,
            option3:option3,
            option4:option4
        }
        //console.warn("User Informations are added!")
        const url = 'http://192.168.0.116:3000/questions';
        let result = await fetch(url,{
            method:"POST",
            headers:{"Content-Type": "application/json"},
            body: JSON.stringify(quesInfo)
        }
            );
            result = await result.json();
            if(result){
                console.warn(result)
            }else{
                console.warn("Data not added")
            }
            
            //navigation.navigate('Display');
    }
    return (
        <View style={styles.container}>
            <Title/>
            <Text style={{fontSize:30, fontWeight:'600', marginBottom:20,color:'#fff'}}>New Question</Text>
            <View style={styles.modalView}>
                {/* <Select options={options} defaultValue={selectValue} 
                placeholder="Select Course" isSearchable/> */}
                 <SelectList boxStyles={{padding:10,width:250,borderColor:'skyblue',marginBottom:10,paddingHorizontal:10}}
        setSelected={(val:any) => setSelectValue(val)} 
        data={selectedCourse} inputStyles={{color:'#989797'}}
        save="value" placeholder='Select Course' search={true}/>
                <TextInput style={styles.question} placeholder='Enter Question' value={ques}
                onChangeText={(ques)=>setQues(ques)}></TextInput>
                <TextInput style={styles.options} placeholder='Option1' value={option1}
                onChangeText={(option1)=>setOption1(option1)}></TextInput>
                <TextInput style={styles.options} placeholder='Option2' value={option2}
                onChangeText={(option2)=>setOption2(option2)}></TextInput>
                <TextInput style={styles.options} placeholder='Option3' value={option3}
                onChangeText={(option3)=>setOption3(option3)}></TextInput>
                <TextInput style={styles.options} placeholder='Option4' value={option4}
                onChangeText={(option4)=>setOption4(option4)}></TextInput>

                <TouchableOpacity style={styles.button} onPress={SaveQues}>               
        <Text style={styles.buttonText}>Create</Text>
        </TouchableOpacity> 

            </View>

        </View>
    )
}
const styles = StyleSheet.create({
    container:{
        backgroundColor: '#00798c',
        alignItems: 'center',
        justifyContent: 'center',
        marginTop:25,
        marginLeft:10,
        marginRight:10,
        borderRadius:10,
        height:'100%'
        
       },
       modalView:{
       marginBottom:50,
       justifyContent:'center',
       alignItems:'center', 
       width:300,
       height:500,
       backgroundColor:'white',
       borderRadius:20,
       shadowColor:'#bbb',
       shadowOpacity:0.80,
       elevation:5
   },
   question:{
    borderWidth:1,
    borderColor:'skyblue',
    borderRadius:10,
    paddingHorizontal:10,
    padding:40,
    paddingTop:10,
    width:250,
    marginBottom:10,

   },
   options:{
    borderWidth:1,
    borderColor:'skyblue',
    borderRadius:10,
    paddingHorizontal:10,
    padding:10,
    paddingTop:10,
    width:250,
    marginBottom:10,
    
   },
   button:{
    width:150,
    height:50,
    backgroundColor:'#00b4d8',
    padding:10,
    borderRadius:15,
    marginTop:10
},
buttonText:{
    color:'#fff',
    fontSize:20,
    justifyContent:'center',
    alignItems:'center',
    textAlign:'center'
    
},
})
export default SetQuiz;
